import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import LadingPage from './screens/lading-page';
import LoginPage from './screens/login-page';

const RoutesComp = () => (
    <BrowserRouter>
        <Routes>
            {/* <Route exact path='/' element={<PrincipalSreen/>}/>
            <Route exact path='/home' element={<PrincipalSreen/>}/>
            <Route exact path='/p/:id' element={<SecondPage/>}/>
            <Route path='*' element={<NotFoundSreen/>}></Route> */}
            <Route path='/' element={<LadingPage/>}></Route>
            <Route path='/login' element={<LoginPage/>}></Route>
        </Routes>
    </BrowserRouter>
)

export default RoutesComp;
